import{_ as e,o as i,c as a,O as t}from"./chunks/framework.9482e208.js";const g=JSON.parse('{"title":"§ 54.1-2208 Unlawful representation as a licensed professional soil scientist or certified wetland delineator.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/54.1-2208.md","filePath":"vacode/54.1-2208.md"}'),r={name:"vacode/54.1-2208.md"},s=t('<h1 id="§-54-1-2208-unlawful-representation-as-a-licensed-professional-soil-scientist-or-certified-wetland-delineator" tabindex="-1">§ 54.1-2208 Unlawful representation as a licensed professional soil scientist or certified wetland delineator. <a class="header-anchor" href="#§-54-1-2208-unlawful-representation-as-a-licensed-professional-soil-scientist-or-certified-wetland-delineator" aria-label="Permalink to &quot;§ 54.1-2208 Unlawful representation as a licensed professional soil scientist or certified wetland delineator.&quot;">​</a></h1><p>A. No person shall represent himself as a licensed professional soil scientist unless he has been so licensed by the Board. Any person practicing or offering to practice soil evaluation within the meaning of this chapter who, through verbal claim, sign, advertisement, or letterhead, represents himself as a licensed professional soil scientist without holding a license from the Board shall be guilty of a Class 1 misdemeanor.</p><p>B. No person shall represent himself as a certified professional wetland delineator unless he has been so certified by the Board. Any person practicing or offering to practice wetland delineation within the meaning of this chapter who, through verbal claim, sign, advertisement, or letterhead, represents himself as a certified professional wetland delineator without holding such a certificate from the Board shall be guilty of a Class 1 misdemeanor.</p><p>1987, c. 626, § 54-971; 1988, c. 765; 2002, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?021+ful+CHAP0784" target="_blank" rel="noreferrer">784</a>; 2011, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?111+ful+CHAP0777" target="_blank" rel="noreferrer">777</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?111+ful+CHAP0859" target="_blank" rel="noreferrer">859</a>.</p>',4),n=[s];function o(l,c,d,f,h,p){return i(),a("div",null,n)}const u=e(r,[["render",o]]);export{g as __pageData,u as default};
